import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <svg viewBox="0 0 16 16" class="svg-1">
          <path d="M1.5 12 h4.5 a 2 2 0 10 4 0 a 2 2 0 10 -4 0 M1.5 12 l3 -10 l3 8 m1 0 l3 -8 l3 10" />
        </svg>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
